import React from "react";
import "./style.css"



function Todo ({todoList,}) {
    console.log(todoList)

    return(

        <div className="Todo-box">

            {todoList.length !==0? 
            todoList.map((each,i) => { 
                return(<div>
                <h2>{each.titleValue}</h2>
                <p>{each.contentValue}</p>
            <button>시작하기</button>
            <button>완료</button>
            </div>
              );
           }  ):""}

        </div>
    );
}

export default Todo;
